import React from 'react'

const MainContent = (props) => {
    return (
        <div>
            <h3>{props.name}</h3>
            <h3>{props.age}</h3>
            <h3>{props.birthday}</h3>
            {props.img.map((image, index) => (
                <img src={image} alt={`${props.name}-${index}`} key={index} />
            ))}

        </div>
    )
}

export default MainContent
